// App.js

import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="Header">
        <img src="header-image.png" alt="Header" className="HeaderImage" />
      </header>
      <div className="Content">
	<div className="Logo">
          <img src="logo.png" alt="Logo" />
        </div>
        <div className="Subscription">
          <iframe src="https://misplacedmusing.substack.com" className="Subscription"></iframe>
        </div>
       </div>
    </div>
  );
}

export default App;
